%[text] ## Simulation of system
%[text] Lets take a random periodic matrix with imposed eigen value on S-N
figure %[output:68da84cb]
S=mreal(rand_phasor(2,2,7,"hurwitzeig",[-1 -0.3],"time_structure","hurwitz",output="PhasorArray")) %[output:62ccb1da]

tmax=15;
T=1 %[output:1de76440]
x0=rand(2,1);
[y,t]=lsim(S,tmax,x0,T,"plot",true,"isRealValued",1);  %[output:9a96ad08] %[output:68da84cb]
%isRealValue ensure only real value are used, tune this argument to true if
%the periodic matrices are real valued
title('x(t)') %[output:68da84cb]

figure %[output:731fabaa]
plot(S{:},T,0:0.01:tmax,title='S(t)') %[output:731fabaa]

figure %[output:9e94db2a]
plot(S.HmqNEig([],T),'*') %[output:9e94db2a]
title('eig(S-N)') %[output:9e94db2a]

%[text] We now add an input to the simulation
B=PhasorArray.random(2,1,5,"time_structure","real")+3 %[output:329d757e]
figure %[output:0df9ad33]
plot(B,T,0:0.01:tmax) %[output:0df9ad33]

figure %[output:7e19bccf]
[y,t]=lsim(S,tmax,x0,T,B,"plot",true,"isRealValued",1); %[output:42bbd36f] %[output:7e19bccf]
title('x(t)') %[output:7e19bccf]

