%[text] ## Lyapunov and Sylvester eq
A=mreal(rand_phasor(4,4,7,"hurwitzeig",[-1 -0.7 -0.1 -0.3],"time_structure","hurwitz",output="PhasorArray")) %[output:9836e989]
Q=PhasorArray(eye(4));

hp=10;
T0=1;

%A^TP + PA +Q =0
P=PhasorArray(Sylv_harmonique(A',A,Q,2*hp,2*pi/T0));
figure %[output:615c8af4]
clf %[output:615c8af4]
plot(P) %[output:615c8af4]
P2 = A.lyap(Q,"T",T0,"thresholdResidual",1e-8) %auto adapt h until accuracy is reached %[output:5f591e63] %[output:0881f4ed]
hold on %[output:615c8af4]
plot(P2) %[output:615c8af4]

figure %[output:2447fbe9]
clf %[output:2447fbe9]
plot(real(P.HmqEig(40)),'*') %[output:2447fbe9]

nx=size(A,1) %[output:1cfc19e0]
nz=2 %[output:9bd3bf7f]

C=PhasorArray(rand_phasor(nz,nx,4,"time_structure","real")) %[output:4ee5dc0b]
O=rand(nz,nz) %[output:1533b29b]

%-OM + MA -C =0
M=PhasorArray(Sylv_harmonique(-O,A,-C,2*hp,2*pi/T0));
plot(M) %[output:223d8500]

